plot

The film mainly follows the famous 1597 Battle of Myeongryang during the Japanese invasion of Korea (1592-159, where the iconic Joseon admiral Yi Sun-sin managed to destroy a total of 133 Japanese warships with only 13 ships remaining in his command. The battle, which took place in the Myeongryang Strait off the southwest coast of the Korean Peninsula, is considered one of the greatest victories of Yi.

